import React from "react";
import "../App.css";
import { Link } from "react-router-dom";
import Header from "./Header";

const LoginRegister = () => {
  return (
    <div>
      <Header text="로그인/회원가입" link="/"></Header>
      <div>
        <div className="loginRegisterContent"></div>
      </div>
    </div>
  );
};

export default LoginRegister;
